import React from "react";
import AppSearchAPIConnector from "@elastic/search-ui-app-search-connector";
import { SearchProvider, Results, SearchBox } from "@elastic/react-search-ui";
import { Layout } from "@elastic/react-search-ui-views";

import "@elastic/react-search-ui-views/lib/styles/styles.css";

const connector = new AppSearchAPIConnector({
  searchKey: "search-j2upnixcxa1k28efrs8sugrv",
  engineName: "play-search",
  endpointBase: "https://play-search.ent.us-central1.gcp.cloud.es.io",
  cacheResponses: false
});

const configurationOptions = {
  apiConnector: connector,
  searchQuery: {
    search_fields: {
      play_name: {}
    },
    result_fields: {
      name: {
        // A snippet means that matching search terms will be highlighted via <em> tags.
        snippet: {
          size: 75, // Limit the snippet to 75 characters.
          fallback: true // Fallback to a "raw" result.
        }
      },
      genre: {
        snippet: {
          size: 50,
          fallback: true
        }
      },
      publisher: {
        snippet: {
          size: 50,
          fallback: true
        }
      },
      critic_score: {
        // Scores are numeric, so we won't attempt to snippet these, we'll just use the raw
        // value.
        raw: {}
      },
      user_score: {
        raw: {}
      },
      platform: {
        snippet: {
          size: 50,
          fallback: true
        }
      },
      image_url: {
        raw: {}
      }
    },
  }
};

function App() {
  return (
    <SearchProvider
      config={configurationOptions}
    >
      <div className="App">
        <Layout
          header={<SearchBox />}
          bodyContent={
          <Results 
          titleField="title" 
          urlField="nps_link" 
          size="15"
          />}
        />
      </div>
    </SearchProvider>
  );
}

export default App;
